  pbar.set_description(f'Loss: {round(float(loss_ave),3)}; \
    Cumulated reward:  {round(float(cumulated_reward),3)};Epoches:')
  pbar.update()

  cumulated_reward = 0
  for step in range(max_steps_per_episode):
    randNum = np.random.rand()
    #print(randNum)

    ####### 1. generate actions
    if randNum < exploration_prob:
      action = env.action_space.sample()
      action = torch.tensor([[action]], dtype = torch.long, device = device)
      #print('Random Action')

    else:
      action = torch.argmax(DQN_policy_model(state)).view(1,1)
    ####### 2. generate next state
    next_state, reward, done, _ = env.step(int(action))

    reward = torch.tensor([reward], dtype = torch.float32, device = device)
    next_state = torch.tensor(next_state[np.newaxis,:], dtype = torch.float32, device = device)

    next_state = None if done else next_state
    ####### store information into replay buffer
    replayBuffer.push(state, action, next_state, reward)

    ####### 3. replace the state with next state value
    state = next_state

    ####### 4. reset the state if the system is 'done' (in 'filling replay buffer' state)
    if len(replayBuffer) < BATCH_SIZE:
      if done:
        cumulated_reward_list.append(cumulated_reward)
        break
      continue
    else: #the training process can only when the number of stored transition transformations is greater than specified batch size

      transitions_sampled = replayBuffer.sample(BATCH_SIZE)

      ####### start reading the replay buffer into batch:
      #re-organize the randomly sampled buffer's structure: elementwise -> attribute-wise
      batch = Transition(*zip(*transitions_sampled))
      #then convert from tuple into tensor
      state_batch = torch.cat(batch.state)
      action_batch = torch.cat(batch.action)
      reward_batch = torch.cat(batch.reward)

      #since next_state is also used to check whether the process is done (whether 'None'), we need special operation to store with this
      ##(decompose it into None or notNone list and notNone's values list)
      non_final_mask_bacth = torch.tensor(tuple(
                                    map(lambda s: s is not None, batch.next_state)
                                    ),
                                    device = device, dtype = torch.bool)  #whether next_state is termination or not

      non_final_next_states_batch = torch.cat([s for s in batch.next_state
                                              if s is not None])
      ####### 5. get the current Q (action) value based on policy (I call it 'active') model
      #batch-wise compute:
      current_q_values = DQN_policy_model(state_batch).gather(1, action_batch)

      ####### 6. get the next Q value with setting zeros and a specific value (max index of next Q) from target (I call it 'lazy') model
      next_q_values = torch.zeros(BATCH_SIZE, device = device)  #first initialize each action's lead result as 0
      with torch.no_grad():
        #only get update the next_q_values which states are not in termination state with maximum Q (action) values
        next_q_values[non_final_mask_bacth] = DQN_target_model(non_final_next_states_batch).max(1).values
        #next_q_values[non_final_mask_bacth] = DQN_policy_model(non_final_next_states_batch).max(1).values

      ####### 7. get the target value by Bellman equation and use it for GD update
      target_q_values = discount_factor * next_q_values + reward_batch  #use Bellman equation

      target_q_values = target_q_values.unsqueeze(1)  #isolate each target Q value of each transition with individual element residing in the list
      loss = criterion(current_q_values, target_q_values)

      loss_ave += float(loss)

      optim.zero_grad()
      loss.backward()
      torch.nn.utils.clip_grad_value_(DQN_policy_model.parameters(), 100)
      optim.step()

      cumulated_reward += int(reward)


      ######## 8. update the lazy model after each batch with slightly increasing towards policy model
      DQN_target_state_dict = DQN_target_model.state_dict()
      DQN_policy_state_dict = DQN_policy_model.state_dict()
      for key in DQN_policy_state_dict:
        DQN_target_state_dict[key] = DQN_policy_state_dict[key] * tau + \
          DQN_target_state_dict[key] * (1-tau)  #tau is the update rate of target network
      DQN_target_model.load_state_dict(DQN_target_state_dict)


      ######### 9. update the exploration rate (decrease) and exploiting rate (increase) after there's a 'done' after current generated action? Also, reset the state value
      if done:
        cumulated_reward_list.append(cumulated_reward)
        step_all = step

        exploration_prob = max(min_exploration_prob, exploration_prob * exploration_decay)
        #print(f'episode: {episode}; taken steps: {step}')
        #plot_reward(cumulated_reward_list)
        break

