"""## Define DNN model"""

class DQN(tf.keras.Model):
  def __init__(self,output_neurons = 2):
    super(DQN,self).__init__()
    self.dense1 = tf.keras.layers.Dense(24, activation = 'relu')
    self.dense2 = tf.keras.layers.Dense(24, activation = 'relu')
    self.output_layer = tf.keras.layers.Dense(output_neurons, activation = 'linear')
    # 'linear': ?

  def call(self, inputs):
    x = self.dense1(inputs)
    x = self.dense2(x)
    return self.output_layer(x)

"""## Intialize environment, hyperparameters"""

# Define the DQN Algorithm Parameters
learning_rate = 0.001
discount_factor = 0.99
# Initial exploration probability (exploration-exploitation)
exploration_prob = 1.0
# Decay rate of exploration probability
exploration_decay = 0.995
# Minimum exploration probability
min_exploration_prob = 0.1

env = gym.make('CartPole-v1') #environment initialization: 4-dimensional vector of the state to balance the pendulum

loss_fn = tf.keras.losses.MeanSquaredError()  #MSE used as loss function

optimizer = tf.keras.optimizers.Adam(learning_rate = learning_rate) #Adam as opimizer to update params

max_episodes = 400
max_steps_per_episode = 500

"""## DQN training"""

dqn_agent = DQN(2)
verbose = False

for episode in range(max_episodes):
  state = env.reset()
  episode_reward = 0  #initialize the reward at each new episode

  for step in range(max_steps_per_episode):
    #choose the epsilon-greedy policy
    if np.random.rand() < exploration_prob:  # hand the exploration-exploitation
      action = env.action_space.sample()
    else:
      action = np.argmax(dqn_agent(state[np.newaxis,:]))  #Returns the indices of the maximum values along an axis.

    next_state, reward, done, _ = env.step(action)

    with tf.GradientTape() as tape:
      current_q_values = dqn_agent(state[np.newaxis, :])
      next_q_values = dqn_agent(next_state[np.newaxis,:])
      max_next_q = tf.reduce_max(next_q_values, axis = -1)

      target_q_values = current_q_values.numpy()

      #Bellman equation (this is the 'ideal' output used for loss comparison):
      target_q_values[0,action] = reward + discount_factor * max_next_q * (1 - done)  #shape?  #reward for this single action

      loss = loss_fn(current_q_values, target_q_values)

    gradients = tape.gradient(loss, dqn_agent.trainable_variables)
    optimizer.apply_gradients(zip(gradients, dqn_agent.trainable_variables))  #use Adam to update params

    if verbose == True:  #print state, action, reward for observation
      print(f'Initial state: {state}, size: {len(state)}')
      print(f'Current Q values: {current_q_values}')
      print(f'Next Q values: {next_q_values}')
      print(f'Max next Q values: {max_next_q}')
      print(f'Tartget Q values: {target_q_values}, size: {len(target_q_values)}')
      print(f'Next state: {next_state}. Action: {action}. Reward: {reward}. Cumulated reward: {episode_reward}')
      print(f'\'done\' content: {done}. \'_\': {_}')
      print(loss)
      #pdb.set_trace()

    state = next_state
    episode_reward += reward  #cumulated reward

    if done:
      break #terminate this episode (from this intial state), since it has reached the destination


  exploration_prob = max(min_exploration_prob, exploration_prob * exploration_decay)
  #decrease the probability to do exploration research, and increase the probability to do exploitation

  if (episode +1) % 100 == 0:
    print(f'Episode {episode + 1}: Reward = {episode_reward}')  #report the cumulated reward intervaled as 100 episode with different initial state
